import { Box, Grid } from "@material-ui/core";

const prueba = () => {
  return (
    <div>
      <Grid container>
        <Grid item xs={6}>
          <Box border={2}></Box>
        </Grid>
      </Grid>
    </div>
  );
};

export default prueba;
